import React from "react";
import "../styles/Pages.css";

const TrendingMovies = () => {
  const trendingMovies = [
    { title: "Avatar: The Way of Water", imageUrl: "https://mir-s3-cdn-cf.behance.net/project_modules/max_1200/4b87fe160451981.63b4d52e574d0.jpg" },
    { title: "Black Panther: Wakanda Forever", imageUrl: "https://static1.colliderimages.com/wordpress/wp-content/uploads/2022/10/BlackPanther-WakandaForever_Payoff_1-Sht_v10_lg.jpg" },
    { title: "The Batman", imageUrl: "https://i0.wp.com/batman-news.com/wp-content/uploads/2022/01/The-Batman-2022-Poster-Duo-HQ-01.jpg?fit=2764%2C4096&quality=80&ssl=1&strip=info" },
    { title: "Spider-Man: No Way Home", imageUrl: "https://image.tmdb.org/t/p/w500/eLvCw6aShF6k3n6V1D4eMc9yTr8.jpg" },
    { title: "Doctor Strange in the Multiverse of Madness", imageUrl: "https://image.tmdb.org/t/p/w500/j9u37rxDwIb9kjQXVrONI5sZxXl.jpg" },
    { title: "Jurassic World: Dominion", imageUrl: "https://image.tmdb.org/t/p/w500/a2FgDTgLffu31ySbm7fxbE1TRVA.jpg" },
    { title: "Minions: The Rise of Gru", imageUrl: "https://image.tmdb.org/t/p/w500/4hf0R7NTUmuDEnPQ3geD5aFVb2X.jpg" },
    { title: "Top Gun: Maverick", imageUrl: "https://image.tmdb.org/t/p/w500/3G4IuVfGgJz9J0A5keqgq15CzQx.jpg" },
    { title: "Thor: Love and Thunder", imageUrl: "https://image.tmdb.org/t/p/w500/lz0Fk7aFip8rZDh6HRlsLJe58gB.jpg" },
    { title: "Uncharted", imageUrl: "https://image.tmdb.org/t/p/w500/8zmTTDCtQczIJ9PB15k5sbRKTmq.jpg" }
  ];

  return (
    <div className="trending-movies">
      <h1>Trending Movies</h1>
      <div className="movies-list">
        {trendingMovies.map((movie, index) => (
          <div className="movie" key={index}>
            <img src={movie.imageUrl} alt={movie.title} />
            <p>{movie.title}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TrendingMovies;
